package com.zaritcare.data.mocks.advice

import javax.inject.Inject

class AdviceDaoMock @Inject constructor() {
    private val balanceImage: String = ""
    private val bedImage: String = ""
    private val doctorImage: String = ""
    private val smileImage: String = ""
    private val tips = mutableListOf<AdviceMock>(
        AdviceMock(
            id = 1,
            title = "Sonríe",
            description = "Sonreír reduce los niveles de hormonas causantes del estrés y la disminución de la presión arterial.",
            image = smileImage
        ),
        AdviceMock(
            id = 2,
            title = "Duerme",
            description = "Esto ayuda a disminuir el estrés y mejorar el estado de ánimo.",
            image = bedImage
        ),
        AdviceMock(
            id = 3,
            title = "Prioriza",
            description = "Nos ayuda a aproximarnos y relacionarnos con los demás, creando vínculos con nuestro entorno a la vez.",
            image = balanceImage
        ),
        AdviceMock(
            id = 4,
            title = "Visita al médico",
            description = "Conocer el estado de tu cuerpo a través de un diagnóstico profesional, no solo te ayudará a ser precavido o controlar enfermedades, también te brindará tranquilidad.",
            image = doctorImage
        )
    )

    fun get(): MutableList<AdviceMock> = tips
    fun get(id: Int): AdviceMock? = tips.find { advice -> advice.id == id }
    fun insert(advice: AdviceMock) = tips.add(advice)
    fun update(newAdvice: AdviceMock) {
        val index: Int = tips.indexOfFirst { advice -> advice.id == newAdvice.id }
        if (index != -1) tips[index] = newAdvice
    }
    fun delete(id: Int) {
        val index = tips.indexOfFirst { advice -> advice.id == id }
        if (index != -1) tips.removeAt(index)
    }
}